DROP TABLE IF EXISTS `stock_history`;
CREATE TABLE `stock_history`  (
  `id` bigint(20) NOT NULL COMMENT '主鍵',
  `stock_id` bigint(20) NOT NULL COMMENT '股票id',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '类型 0: 日 1: 周 2: 月',
  `date` date NOT NULL COMMENT '日期',
  `opening` decimal(16, 2) NOT NULL COMMENT '開盤',
  `highest` decimal(16, 2) NOT NULL COMMENT '最高',
  `lowest` decimal(16, 2) NOT NULL COMMENT '最低',
  `closing` decimal(16, 2) NOT NULL COMMENT '收盤',
  `ups_downs` decimal(10, 2) NULL DEFAULT NULL COMMENT '漲跌',
  `rise_rate` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '漲%',
  `vol` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '成交量',
  `amount` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '成交金額',
  `per` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '本益比',
  `averagevol5` decimal(16, 2) NULL DEFAULT NULL COMMENT '5日/周/月成交量均线',
  `average5` decimal(16, 2) NULL DEFAULT NULL COMMENT '5日/周/月均线',
  `average10` decimal(16, 2) NULL DEFAULT NULL COMMENT '10日/周/月均线',
  `average20` decimal(16, 2) NULL DEFAULT NULL COMMENT '20日/周/月均线',
  `average60` decimal(16, 2) NULL DEFAULT NULL COMMENT '60日/周/月均线',
  `create_date` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_date` datetime(0) NULL DEFAULT NULL COMMENT '最后更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '股票交易歷史記錄表' ROW_FORMAT = Compact;

